import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Footer from './Components/Footer';
import Home from './Components/Home';
import HeaderAtas from './Components/navbar';

function App() {
  return (
    <div className="App">
     <HeaderAtas/>
     <Home/>
     <Footer/>
    </div>
  );
}

export default App;
